import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 28, height: 28, viewBox: "0 0 28 28", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M15.64 4.86A1.63 1.63 0 0013 6.13v4.57L5.64 4.86A1.63 1.63 0 003 6.13v15.74a1.63 1.63 0 002.64 1.27L13 17.31v4.56a1.62 1.62 0 002.64 1.27l9.63-7.64c.97-.76.97-2.23 0-3l-9.63-7.64z", fill: primaryFill }));
};
const FastForward28Filled = wrapIcon(rawSvg({}), 'FastForward28Filled');
export default FastForward28Filled;
